import React from 'react';
import './Menu.css';

const Menu = () => {
    return (
            <div className='container-fluid'>
                <div className='row'>
                    <nav id="sidebarMenu" className='sidebar'>
                        <div className='position-sticky'>
                            <ul className='nav flex-column'>
                                <li>Главная</li>
                                <li>Блок 1</li>
                                <li>Блок 2</li>
                                <li>Блок 3</li>
                                <li>Блок 4</li>
                                <li>Блок 5</li>
                                <li>Свод по профилям</li>
                                <li>Свод по направлениям</li>
                                <li>Своб по подразделениям</li>
                            </ul>
                        </div>
                    </nav>
                </div>
            </div>
    );
}

export default Menu;
